import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import firebase from "firebase";

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

firebase.initializeApp({
  apiKey: "AIzaSyCBxdHVuDFIg-zdEeB1VYDHz7yEZ4HRhVI",
  authDomain: "striveworks-test.firebaseapp.com",
  projectId: "striveworks-test",
  storageBucket: "striveworks-test.appspot.com",
  messagingSenderId: "566771220402",
  appId: "1:566771220402:web:dd321a7a657e3f5d3beeab"
});
